eval("__webpack_require__.r(__webpack_exports__);\nlet architectures = [{\n  title: \"Folkless Upgrades\",\n  image: \"/images/folkless.png\",\n  des: `<p class='p-des'>As with all software, to remain timely, useful and relevant, blockchain software requires upgrades for continued development. Early generation blockchain upgrades required forking, a process requiring weeks, if not months to deploy.</p> <p> Upgrades through the forking process can become controversial, sometimes leading to a hard fork, which in essence splits the development community in two. Selendra employs forkless upgrades enacted through an on-chain governance system, thereby creating enhanced stability through avoiding the forked upgrade process altogether.</p>`\n}, {\n  title: \"Consensus Architecture, Consensus Roles\",\n  image: \"/images/consensus.png\",\n  des: `<p class='p-des'><strong>Selendra</strong> has four distinct roles for reaching consensus: </p>\n    <p><strong>Validators</strong> secure the network through the process of staking, validating proofs from collators, and through participating in consensus with other validators.</p>\n    <p class='p-des'><strong>Collators</strong> maintain data shards by collecting shard transactions and producing proofs for validators. They also monitor the network and report abuse to validators.</p>\n    <p class='p-des'><strong>Nominators</strong> secure the network by selecting trustworthy validators and stakers.</p>\n    <p class='p-des'><strong>Fishermen</strong> monitor the network and report abuse to validators.</p>`\n}, {\n  title: \"Governance Roles\",\n  image: \"/images/governance.png\",\n  des: `<p class='p-des'>Selendra uses a governance mechanism of two distinct committee types that ensure the majority of stakeholders will always secure the network.<strong>SEL Holders</strong> committees are elected to represent passive stakeholders in two primary governance roles, which are proposing referenda, and vetoing dangerous or malicious referenda.</p>\n    <p class='p-des'><strong>Technical</strong> committees are composed of active Selendra developers who propose emergency referenda and new features together with the Holders Council for fast-tracked voting and implementation.</p>`\n}, {\n  title: \"Rewards\",\n  image: \"/images/reward.png\",\n  des: \"<p class='p-des'><strong>Selendra</strong> incentivizes decentralization to maximize chain security through two primary role mechanisms, that of validators and nominators.</p> <p> Validators with greater stakes tend to have more resources for maintaining infrastructure, therefore, validator rewards are paid the same regardless of stake level. Generally, validators with lesser stake levels will pay more to nominators, whereby nominators have an economic incentive to shift toward lower stake validators, resulting in more evenly distributed stakes across validators and avoiding concentrations of power. </p>\"\n}, {\n  title: \"Transaction Fees\",\n  image: \"/images/fee.png\",\n  des: \"<p class='p-des'>Transaction fees are among the greatest barriers hindering mainstream adoption. Selendra&rsquo;s approach to this issue is to make transaction fees fixed and very low from the start. Selendra transaction fees are fixed at 0.00001 SEL per transaction. Since the cost per transaction is fixed to the SEL token, the cost per transaction will only vary relative to the SEL token price.</p> <p>Network governance bodies such as validators, norminator, collators and fishermen are rewarded through the staking process, with 30% of transaction fees being paid as rebates, while the remaining 70% are taken out of existence. </p>\"\n}, {\n  title: \"Network Abuse Mitigation\",\n  image: \"/images/network.png\",\n  des: \"<p class='p-des'>As Selendra transaction fees are inherently low, the possibility of attack on computing resources is a possibility. To mitigate this issue, prior to performing any transaction, Selendra account holders must maintain a minimum balance of 0.10 SEL (this minimum balance amount will be adjusted accordingly as the network develops).</p> <p>A minimum balance deposit is used to deter network attacks, where the deposit is forfeited upon detection of network abuse. Forfeited deposits are added to the reward pool fund for future payments to validators and other network participants. </p>\"\n}];\n/* harmony default export */ __webpack_exports__[\"default\"] = (architectures);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/architectures.js\n");

